import axios from "axios";
import React from "react";
import "./css/dashboard.css"

function dashboard(){

    

    return(
        <div>
            <header>
                <nav class="nav">
                    <ul class="nav_list">
                        <li class="nav_user"><img src="static/images/person icon.svg" alt=""/></li>
                        <li class="nav_name">Hello,Shivani!</li>
                        <li class="nav_settings"><a href="#" class="nav_link"><img src="static/images/Settings.svg" alt=""/></a></li>
                        <li class="nav_bell"><a href="#" class="nav_link"><img src="static/images/Alarm.svg" alt=""/></a></li>
                    </ul>
                </nav>
            </header>
            
        </div>
    )
}

export default dashboard;
